import React from 'react';
import css from "./Product.css";

const Product = (props) => {
    const { product } = props;

    return (
        <div>
            <img src={product.image}
                alt={product.title}
                className="product__img" />
            <span className="product_name">
                {product.title}
            </span>
        </div>
    )
}

export default Product
